import { ShoppingBag, Menu } from "lucide-react";
import { useState, useEffect } from "react";

export function Header() {
  const [isSticky, setIsSticky] = useState(false);
  const [isDrawerOpen, setIsDrawerOpen] = useState(false);

  useEffect(() => {
    const handleScroll = () => {
      if (window.scrollY > 0) {
        setIsSticky(true);
      } else {
        setIsSticky(false);
      }
    };

    window.addEventListener("scroll", handleScroll);

    return () => {
      window.removeEventListener("scroll", handleScroll);
    };
  }, []);

  const toggleDrawer = () => {
    setIsDrawerOpen(!isDrawerOpen);
  };

  return (
    <>
      {/* Left Drawer */}
      <div className={`fixed inset-y-0 left-0 transform ${isDrawerOpen ? 'translate-x-0' : '-translate-x-full'} w-64 bg-white shadow-lg transition-transform duration-300 ease-in-out z-50`}>
        <div className="p-6 space-y-4">
          <a href="#" className="block text-gray-600 font-medium font-jost uppercase hover:text-gray-900">Home</a>
          <a href="#" className="block text-gray-600 font-medium font-jost uppercase hover:text-gray-900">About</a>
          <a href="#" className="block text-gray-600 font-medium font-jost uppercase hover:text-gray-900">Gallery</a>
          <a href="#" className="block text-gray-600 font-medium font-jost uppercase hover:text-gray-900">RSVP</a>
          <a href="#" className="block text-gray-600 font-medium font-jost uppercase hover:text-gray-900">Registry</a>
        </div>
      </div>

      {/* Overlay */}
      {isDrawerOpen && (
        <div
          className="fixed inset-0 bg-black bg-opacity-50 z-40"
          onClick={toggleDrawer}
        />
      )}

      <header className={`transition-all duration-300 ${isSticky ? "fixed top-0 left-0 right-0 bg-white shadow-[0_4px_6px_-1px_rgba(8,106,216,0.1),0_2px_4px_-1px_rgba(0,0,0,0.06)] z-50" : ""}`}>
        <div className="max-w-4xl mx-auto py-4 px-4 border-b border-gray-100">
          <nav className="container mx-auto flex justify-between items-center">
            {/* Hamburger Menu Button - Visible on mobile */}
            <button
              className="sm:hidden text-gray-600 hover:text-gray-900"
              onClick={toggleDrawer}
            >
              <Menu className="w-6 h-6" />
            </button>

            <div className="flex gap-8 hidden sm:flex">
              <a
                href="#"
                className="text-gray-600 font-medium font-jost uppercase hover:text-gray-900"
              >
                Home
              </a>
              <a
                href="#"
                className="text-gray-600 font-medium font-jost uppercase hover:text-gray-900"
              >
                About
              </a>
              <a
                href="#"
                className="text-gray-600 font-medium font-jost uppercase hover:text-gray-900"
              >
                Gallery
              </a>
            </div>
            {loveLoveSymbol()}
            <div className="sm:hidden"></div>
            <div className="flex gap-8 hidden sm:flex">
              <a
                href="#"
                className="text-gray-600 font-medium font-jost uppercase hover:text-gray-900"
              >
                RSVP
              </a>
              <a
                href="#"
                className="text-gray-600 font-medium font-jost uppercase hover:text-gray-900"
              >
                Registry
              </a>
              <a
                href="#"
                className="text-gray-600 font-medium font-jost uppercase hover:text-gray-900"
              >
                <ShoppingBag className="w-5 h-5" />
              </a>
            </div>
          </nav>
        </div>
      </header>
    </>
  );
}

